import React from 'react';
import ReactDom from 'react-dom';
import Grouping from './Grouping';

function Tile(props){
    return <div className='tile'>
        
        <h1>
            {props.name}
        </h1>
        <p>{Grouping}</p>
    </div>
}

export default Tile;
